   "source": [
    "# Introduction \n",
    "\n",
    "- El coste de los reingresos hospitalarios representa una gran parte del gasto en servicios de hospitalización. La diabetes no sólo es una de las diez principales causas de muerte en el mundo, sino también la enfermedad crónica más cara en Estados Unidos. Los pacientes hospitalizados con diabetes corren un mayor riesgo de reingreso que los que no tienen diabetes. Por lo tanto, la reducción de las tasas de reingreso de los pacientes diabéticos tiene un gran potencial para reducir el coste médico de forma significativa. El objetivo de este estudio es predecir la probabilidad de que un paciente diabético sea readmitido. El conjunto de datos se obtuvo del Centro de Aprendizaje Automático y Sistemas Inteligentes de la Universidad de California, Irvine, y contiene más de 100.000 atributos y 50 características, como el número de procedimientos, el número de medicamentos y el tiempo de estancia en el hospital, etc. \n"
   ]
  },
