    "## 4.3 k-Fold Cross-validation \n",
    "La validación cruzada es una técnica que permite dividir los datos varias veces para obtener una mejor estimación de la métrica de rendimiento. La validación cruzada de K veces se utiliza habitualmente para reducir el sesgo asociado al muestreo aleatorio del entrenamiento.\n",
    "\n",
    "En este estudio, para estimar el rendimiento del clasificador se utiliza un algoritmo de validación cruzada estratificada de 10 veces. Este método de validación cruzada divide los datos aleatoriamente en 10 partes iguales mutuamente excluyentes. Nueve partes se utilizan para entrenar el algoritmo y una parte para evaluarlo. Este proceso se ejecuta 10 veces utilizando diferentes partes de entrenamiento y de prueba.\n",
    "\n",
    "\n",
    "![image.png](attachment:image.png)"
   ]
